import card_iron from '../assets/card.png'
import card_hulk from '../assets/card.png'
import card_iron2 from '../assets/card.png'
import card_thor from '../assets/card.png'
import card_cap from '../assets/card.png'
import card_avengers from '../assets/card.png'

export const Phase1 = [
	{
		id: 0,
		name: 'Iron Man',
		release: 'May 2008',
		background: card_iron,
	},
	{
		id: 1,
		name: 'Hulk',
		release: 'June 2008',
	},
	{
		id: 2,
		name: 'Iron Man 2',
		release: 'May 2010',
	},
	{
		id: 3,
		name: 'Thor',
		release: 'May 2011',
	},
	{
		id: 4,
		name: 'Captain America',
		release: 'June 2011',
	},
	{
		id: 5,
		name: 'Avengers',
		release: 'May 2012',
	},
]
